// src/pages/HomePage.js
import React from 'react';
import { Card } from 'primereact/card';
import { Button } from 'primereact/button';
import { Footer } from 'primereact/footer';

const HomePage = () => {
    const footer = (
        <div style={{ textAlign: 'center', marginTop: '2rem' }}>
            <p>Nombre y Apellido: Juan Pérez</p>
            <p>Materia: Gestión de APIs</p>
            <p>Docente: Prof. Gómez</p>
            <p>Comisión: 3B</p>
        </div>
    );

    return (
        <div className="p-grid p-align-center p-justify-center" style={{ minHeight: '100vh', backgroundColor: '#f4f4f4' }}>
            <div className="p-col-12 p-md-6">
                <Card title="Bienvenido a la API de Gestión de Vinos" 
                    subTitle="Utiliza los siguientes enlaces para acceder a los endpoints" 
                    footer={footer} 
                    style={{ textAlign: 'center', padding: '2rem', boxShadow: '0 2px 8px rgba(0,0,0,0.1)' }}
                >
                    <Button label="Ver Usuarios" className="p-button-link" onClick={() => window.location.href = "/usuarios"} />
                    <Button label="Ver Vinos" className="p-button-link" onClick={() => window.location.href = "/vinos"} style={{ marginLeft: '1rem' }} />
                </Card>
            </div>
        </div>
    );
};

export default HomePage;
